import React, {Component} from 'react'
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import Button from './menuButton'

class Menu extends Component {
	render() {
		return (
			<AppBar>
				<Toolbar>
					Button("Men√º")
					Button("Login")
					Button("Registrieren")
				</Toolbar>
			</AppBar>
		)
	}
}

export default Menu
